import React from "react";
import { BsCloudUploadFill } from "react-icons/bs";

export const RightSide = () => {
  return (
    <div className="bg-white sticky top-10 h-fit rounded-3xl p-4 flex flex-col gap-4">
      <div className="w-full py-24 flex flex-col gap-4 justify-center items-center bg-sky-100 rounded-3xl">
        <BsCloudUploadFill className="text-5xl text-sky-950" />
        <span className="font-titleFont font-medium text-lg">
          Add new files
        </span>
      </div>
      <div className="w-full p-4 flex flex-col gap-4 bg-sky-100 rounded-3xl">
        <div className="flex justify-between">
          <span className="font-titleFont text-base">Your storage</span>
          <span className="font-bodyFont text-sm font-semibold">25% left</span>
        </div>
      </div>
    </div>
  );
};
